function calcularTempoRestante() {
  var agora = new Date();
  var meiaNoiteProxima = new Date(agora);
  meiaNoiteProxima.setHours(24, 0, 0, 0);
  var diferenca = meiaNoiteProxima.getTime() - agora.getTime();
  var segundosRestantes = Math.floor(diferenca / 1000);

  return segundosRestantes;
}

var tempoRestante = calcularTempoRestante();
